import React from "react";
import Card from "./Card";
import Sdata from "./Sdata";

const Netflix = () => {
  return (
    <>
      <h1 className="heading-style">List of TOP Most Webseries in Netflix</h1>
      {Sdata.map(
        (Ncard = (val) => {
          return (
            <Card
              imgsrc={val.imgsrc}
              title={val.title}
              sname={val.sname}
              links={val.links}
            />
          );
        })
      )}
    </>
  );
};

export default Netflix;
